description:
The movie is a combination of 4 independent loops: &quot;Das vogelnde Klassenzimmer&quot; (scenes 1-2), &quot;Hurra, die Mose brennt&quot; (scenes 3-6), &quot;Resi's Fick-Theater&quot; (scenes 7-17) and &quot;Die Pinsel von der Liebesinsel&quot; (scenes 18-22). The segments are tied together by some schoolgirl-report-style interviews on the street, with supposed members of the public.

